import React from 'react';
import './Cards.css';
import CardItem from './CardItem';

function Facilities() {
  return (
    <div className='cards'>
     
      <div className='cards__container'>
        <div className='cards__wrapper'>
          
            <ul className='cards__items'>
            
            <li>
                <ld>
                  R<sup>x</sup> IV, IM, or other injections 
                </ld>
            </li>
          </ul>
        </div>
      </div>
    </div>
  );
}

export default Facilities;
